var n=Ember.HTMLBars.template({id:"NIT4T5ls",block:'{"symbols":[],"statements":[[1,[21,"outlet"],false],[0,"\\n\\n"],[1,[27,"ui-slick",null,[["slides"],[[23,["model","headerSlides"]]]]],false],[0,"\\n\\n"],[7,"section"],[11,"class","container"],[9],[0,"\\n\\n\\t"],[7,"h2"],[9],[0,"Satzung"],[10],[0,"\\n  "],[7,"p"],[9],[0,"Stand vom 29.01.2011"],[10],[0,"\\n\\n\\t"],[7,"h3"],[9],[0,"§1 Name, Sitz, Geschäftsjahr"],[10],[0,"\\n\\t"],[7,"ol"],[9],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Der Verein trägt den Namen: Förderverein der Freiwilligen Feuerwehr Erfurt-Molsdorf. Er soll in das Vereinsregister eingetragen werden, nach der Eintragung lautet der Name: Förderverein der Freiwilligen Feuerwehr Erfurt-Molsdorf e.V. nachstehend Förderverein genannt.\\n    "],[10],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Der Förderverein ist politisch und religiös neutral.\\n    "],[10],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Sitz des Fördervereins ist Erfurt-Molsdorf.\\n    "],[10],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Erfüllungsort und Gerichtsstand ist am eingetragenen Sitz des Fördervereins.\\n    "],[10],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Das Geschäftsjahr ist das Kalenderjahr. Das erste Geschäftsjahr ist ein Rumpfgeschäftsjahr vom Tage der Eintragung bis zum 31.12.2001.\\n    "],[10],[0,"\\n\\t"],[10],[0,"\\n\\n\\t"],[7,"h3"],[9],[0,"§2 Zweck des Fördervereins"],[10],[0,"\\n\\t"],[7,"ol"],[9],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Der Förderverein hat die Aufgabe, den Feuerwehrgedanken nach den geltenden Gesetzen über den Brandschutz, die Allgemeine Hilfe und den Katastrophenschutz zu fördern. Diese Zielsetzung wird insbesondere verwirklicht:\\n    "],[10],[0,"\\n    "],[7,"ol"],[11,"type","a"],[9],[0,"\\n      "],[7,"li"],[9],[0,"\\n        durch ideelle und materielle Unterstützung des Feuerwehrwesens im Ortsteil Erfurt-Molsdorf,\\n      "],[10],[0,"\\n      "],[7,"li"],[9],[0,"\\n        durch die Wahrnehmung der Interessen der Feuerwehr und ihrer Angehörigen,\\n      "],[10],[0,"\\n      "],[7,"li"],[9],[0,"\\n        durch die Betreuung der nicht mehr aktiv tätigen Feuerwehrleute,\\n      "],[10],[0,"\\n      "],[7,"li"],[9],[0,"\\n        durch Beratung der Aufgabenträger in Fragen des Brandschutzes, der Allgemeinen Hilfe und des Katastrophenschutzes,\\n      "],[10],[0,"\\n      "],[7,"li"],[9],[0,"\\n        durch Öffentlichkeitsarbeit und Anregungen aller Art.\\n      "],[10],[0,"\\n    "],[10],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Der Förderverein unterstützt finanziell und personell das geistig-kulturelle Leben im Ortsteil Erfurt-Molsdorf insbesondere bei der Wahrung dörflicher Traditionen sowie der Kinder- und Jugendarbeit. Im Rahmen seiner Satzung arbeitet der Förderverein mit anderen im Ortsteil tätigen gemeinnützigen Vereinen zusammen. \\n    "],[10],[0,"\\n\\t"],[10],[0,"\\n\\n\\t"],[7,"h3"],[9],[0,"§3 Gemeinnützigkeit"],[10],[0,"\\n\\t"],[7,"ol"],[9],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Der Förderverein verfolgt ausschließlich und unmittelbar gemeinnützige Ziele im Sinne des Abschnittes „Steuerbegünstigte Zwecke“ der Abgabenordnung.\\n    "],[10],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Der Förderverein ist selbstlos tätig und fördert nicht in erster Linie eigenwirtschaftliche Zwecke.\\n    "],[10],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Die Mittel des Fördervereins dürfen nur für die satzungsmäßigen Ziele verwendet werden. Die Mitglieder erhalten keine Zuwendungen aus den Mitteln des Fördervereins.\\n    "],[10],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Es darf keine Person durch Ausgaben, die dem Zweck des Fördervereins fremd sind oder durch unverhältnismäßig hohe Vergütungen begünstigt werden.\\n    "],[10],[0,"\\n\\t"],[10],[0,"\\n\\n\\t"],[7,"h3"],[9],[0,"§4 Vereinsarbeit"],[10],[0,"\\n\\t"],[7,"ol"],[9],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Zur Erfüllung seiner Aufgaben führt der Förderverein geschlossene Veranstaltungen und Schulungen durch.\\n    "],[10],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Der Förderverein unternimmt Aktionen zur Wahrung und Pflege von Feuerwehrtraditionen.\\n    "],[10],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Der Förderverein führt geeignete Maßnahmen zur stetigen Verbesserung der Öffentlichkeitsarbeit und zur Verbreitung des Feuerwehrgedankens durch.\\n    "],[10],[0,"\\n\\t"],[10],[0,"\\n\\n\\t"],[7,"h3"],[9],[0,"§5 Mitgliedschaft"],[10],[0,"\\n\\t"],[7,"ol"],[9],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Dem Förderverein können angehören:\\n    "],[10],[0,"\\n    "],[7,"ol"],[11,"type","a"],[9],[0,"\\n      "],[7,"li"],[9],[0,"\\n        Feuerwehrangehörige,\\n      "],[10],[0,"\\n      "],[7,"li"],[9],[0,"\\n        nicht mehr aktiv tätige Feuerwehrleute,\\n      "],[10],[0,"\\n      "],[7,"li"],[9],[0,"\\n        Ehrenmitglieder,\\n      "],[10],[0,"\\n      "],[7,"li"],[9],[0,"\\n        fördernde Mitglieder und\\n      "],[10],[0,"\\n      "],[7,"li"],[9],[0,"\\n        Mitglieder der Jugendfeuerwehr.\\n      "],[10],[0,"\\n    "],[10],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Nicht mehr aktiv tätige Feuerwehrleute sind solche Personen, die Feuerwehrangehörige gewesen sind und die Altersgrenze erreicht haben oder vorher auf eigenen Wunsch und ehrenhaft aus dem Dienst ausgeschieden sind.\\n    "],[10],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Ehrenmitglieder sind natürliche Personen, die sich besondere Verdienste um das Feuerwehrwesen erworben haben. Ehrenmitglieder werden auf Vorschlag des Vorstandes von der Mitgliederversammlung ernannt.\\n    "],[10],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Fördernde Mitglieder können unbescholtene natürliche oder juristische Personen sein, die durch ihren Beitritt ihre Verbundenheit mit der Feuerwehr bekunden wollen.\\n    "],[10],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Wahlberechtigte sind Mitglieder mit vollendetem 16. Lebensjahr und wählbar sind Mitglieder mit vollendetem 18. Lebensjahr.\\n    "],[10],[0,"\\n\\t"],[10],[0,"\\n\\n\\t"],[7,"h3"],[9],[0,"§6 Erwerb der Mitgliedschaft "],[10],[0,"\\n\\t"],[7,"ol"],[9],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Mitglieder des Fördervereins können natürliche und juristische Personen werden, sofern ihre Mitgliedschaft nicht den Zwecken des Fördervereins zuwider läuft.\\n    "],[10],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Voraussetzung für den Erwerb der Mitgliedschaft ist ein Aufnahmeantrag, über den der Vorstand des Fördervereins entscheidet. Bei Ablehnung des Antrages ist dieser nicht verpflichtet dem Antragsteller die Gründe mitzuteilen. Die Mitgliedschaft beginnt mit dem Eingang der ersten Beitragszahlung. Die erste Beitragszahlung ist als Jahresbeitrag für das Jahr zu entrichten, ab dem Monat in dem der Erwerb der Mitgliedschaft erfolgt. Die Zahlungsfrist beträgt 4 Wochen ab Annahmebestätigung der Mitgliedschaft.\\n    "],[10],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Grundlage für die Mitgliedschaft ist das Bekenntnis zur freiheitlichen demokratischen Grundordnung sowie weltanschauliche Toleranz. Einer Aufnahme in den Förderverein steht insbesondere entgegen:\\n    "],[10],[0,"\\n    "],[7,"ol"],[11,"type","a"],[9],[0,"\\n      "],[7,"li"],[9],[0,"\\n        die Mitgliedschaft, der Beitritt oder die Zugehörigkeit zu einer für verfassungswidrig erklärten Partei oder Vereinigung oder,\\n      "],[10],[0,"\\n      "],[7,"li"],[9],[0,"\\n        die Mitgliedschaft, der Beitritt oder die Zugehörigkeit zu einer nicht verbotenen Partei oder sonstigen Vereinigungen oder Gruppierungen, die mit der freieheitlichen demokratischen Grundordnung unvereinbare Ziele verfolgt\\n      "],[10],[0,"\\n    "],[10],[0,"\\n\\t"],[10],[0,"\\n\\n\\t"],[7,"h3"],[9],[0,"§7 Beiträge"],[10],[0,"\\n\\t"],[7,"ol"],[9],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Die Mitglieder zahlen einen Jahresbeitrag. Die Höhe wird durch die Mitgliederversammlung des Fördervereins festgelegt.\\n    "],[10],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Der Jahresbeitrag ist im ersten Quartal des Jahres im Voraus zu zahlen.\\n    "],[10],[0,"\\n\\t"],[10],[0,"\\n\\n\\t"],[7,"h3"],[9],[0,"§8 Beendigung der Mitgliedschaft"],[10],[0,"\\n\\t"],[7,"ol"],[9],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Die Mitgliedschaft endet durch Tod, Kündigung, Streichung oder Ausschluss.\\n    "],[10],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Die Mitgliedschaft kann zum Ende eines jeden Monats mit einer Frist von vier Wochen schriftlich gekündigt werden.\\n    "],[10],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Der Ausschluss ist mit sofortiger Wirkung auszusprechen, wenn ein Mitglied gegen die Interessen des Fördervereins verstößt oder die bürgerlichen Ehrenrechte verliert.\\n    "],[10],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Der Ausschluss kann ausgesprochen werden, wenn ein Mitglied mit dem in der Mitgliederversammlung beschlossenen Beitrag länger als ein halbes Jahr nach Zahlungsfrist im Verzug ist oder keinerlei Aktivitäten zum Wohle des Vereins zeigt.\\n    "],[10],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Mit dem Ausscheiden erlöschen alle vermögensrechtlichen Ansprüche des Mitgliedes gegen den Förderverein.\\n    "],[10],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Beiträge für das laufende Jahr werden nicht zurück gezahlt, zum Zeitpunkt des Austrittes ausstehende \\n    "],[10],[0,"\\n\\t"],[10],[0,"\\n\\n\\t"],[7,"h3"],[9],[0,"§9 Organe des Fördervereins"],[10],[0,"\\n\\t"],[7,"ol"],[9],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Organe des Fördervereins sind:\\n    "],[10],[0,"\\n    "],[7,"ol"],[11,"type","a"],[9],[0,"\\n      "],[7,"li"],[9],[0,"\\n        Mitgliederversammlung\\n      "],[10],[0,"\\n      "],[7,"li"],[9],[0,"\\n        Vorstand\\n      "],[10],[0,"\\n      "],[7,"li"],[9],[0,"\\n        Beirat\\n      "],[10],[0,"\\n    "],[10],[0,"\\n\\t"],[10],[0,"\\n\\n\\t"],[7,"h3"],[9],[0,"§10 Mitgliederversammlung"],[10],[0,"\\n\\t"],[7,"ol"],[9],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Die Mitgliederversammlung setzt sich aus den Fördervereinsmitgliedern zusammen und ist das oberste Beschlussorgan.\\n    "],[10],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Die Mitgliederversammlung wird vom Fördervereinsvorsitzenden oder im Verhinderungsfalle von seinen Vertreter geleitet und ist mindestens einmal jährlich unter Bekanntgabe der vorgesehenen Tagesordnung mit einer 14 tägigen Frist einzuberufen. Die Einberufung erfolgt schriftlich auf Beschluss des Vorstandes.\\n    "],[10],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Auf Antrag von mindestens einem Drittel der Mitglieder ist innerhalb einer vierwöchigen Frist eine außerordentliche Mitgliederversammlung einzuberufen. In dem Antrag müssen die zu behandelnden Tagesordnungspunkte bezeichnet sein.\\n    "],[10],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Die Aufgaben der Mitgliederversammlung sind:\\n    "],[10],[0,"\\n    "],[7,"ol"],[11,"type","a"],[9],[0,"\\n      "],[7,"li"],[9],[0,"\\n        Beratung und Beschlussfassung über eingebrachte Anträge,\\n      "],[10],[0,"\\n      "],[7,"li"],[9],[0,"\\n        die Wahl und die Entlastung der Mitglieder des Vorstandes,\\n      "],[10],[0,"\\n      "],[7,"li"],[9],[0,"\\n        die Wahl und die Entlastung der Mitglieder des Beirates,\\n      "],[10],[0,"\\n      "],[7,"li"],[9],[0,"\\n        die Festsetzung des Mitgliedsbeitrages,\\n      "],[10],[0,"\\n      "],[7,"li"],[9],[0,"\\n        die Genehmigung der Jahresrechnung,\\n      "],[10],[0,"\\n      "],[7,"li"],[9],[0,"\\n        Beschlussfassung über Satzungsänderungen,\\n      "],[10],[0,"\\n      "],[7,"li"],[9],[0,"\\n        Beschlussfassung über die Verleihung der Ehrenmitgliedschaft,\\n      "],[10],[0,"\\n      "],[7,"li"],[9],[0,"\\n        Entscheidung von Beschwerden der Mitglieder gegen den Vorstand,\\n      "],[10],[0,"\\n      "],[7,"li"],[9],[0,"\\n        Beschlussfassung über die Auflösung des Fördervereins.\\n      "],[10],[0,"\\n    "],[10],[0,"\\n\\t"],[10],[0,"\\n\\n\\t"],[7,"h3"],[9],[0,"§11 Verfahrensordnung für die Mitgliederversammlung"],[10],[0,"\\n\\t"],[7,"ol"],[9],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Die Mitgliederversammlung ist beschlussfähig, wenn sie ordnungsgemäß eingeladen wurde und mindestens ein Drittel der Mitglieder anwesend ist.\\n    "],[10],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Die Mitgliederversammlung beschließt mit einfacher Mehrheit der abgegebenen Stimmen, Stimmengleichheit bedeutet Ablehnung. Satzungsänderungen bedürfen der Mehrheit von zwei Drittel der abgegebenen Stimmen. Abstimmungen erfolgen im Grundsatz offen. Die Mitgliederversammlung kann auf Antrag eines Mitgliedes beschließen, geheim abzustimmen.\\n    "],[10],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Satzungsänderungen, welche die Gemeinnützigkeit des Fördervereins in Frage stellen, sind unzulässig.\\n    "],[10],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Über die Mitgliederversammlung ist ein Protokoll anzufertigen, dessen Richtigkeit vom Schriftführer und dem Vorsitzenden zu bestätigen ist.\\n    "],[10],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Jedes Mitglied ist berechtigt, seine Anträge zu Protokoll zu geben.\\n    "],[10],[0,"\\n\\t"],[10],[0,"\\n\\n\\t"],[7,"h3"],[9],[0,"§12 Vorstand"],[10],[0,"\\n\\t"],[7,"ol"],[9],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Der Vorstand besteht aus dem Vorsitzenden, dem stellvertretenden Vorsitzenden, dem Schriftführer, dem Kassenführer und einem weiteren Mitglied, mindestens 3 Vorstandsmitglieder müssen aktive Feuerwehrleute sein.\\n    "],[10],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Die Rechtsvertretung des Vereins wird durch die in den Vorstand gewählten: Vereinsvorsitzender, stellvertretender Vorsitzender, Kassenführer und Schriftführer vorgenommen. Jeder ist alleinvertretungsberechtigt.\\n    "],[10],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Der Vorstand führt die Geschäfte des Fördervereins nach den Beschlüssen und Richtlinien der Mitgliederversammlung ehrenamtlich. Er hat die Beschlüsse zu verwirklichen und die Mitglieder angemessen über die Fördervereinsangelegenheiten zu unterrichten. Der Vorstand bleibt bis zur Neuwahl im Amt.\\n    "],[10],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Die Vorstandsmitglieder werden von der Mitgliederversammlung jeweils auf die Dauer von 2 Jahren gewählt.\\n    "],[10],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Der Vorsitzende lädt die Mitglieder zu der Mitgliederversammlung ein und leitet die Versammlung. Er beruft die Vorstandssitzungen ein und leitet diese. Über die Vorstandssitzungen ist ein Protokoll anzufertigen und vom Vorsitzenden zu unterzeichnen.\\n    "],[10],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Der Vorstand fasst seine Beschlüsse mit der Mehrheit seiner gewählten Mitglieder. Beschlussfassung auf schriftlichen Weg ist zulässig.\\n    "],[10],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Mitglieder des Vorstandes müssen das 18.Lebensjahr vollendet haben.\\n    "],[10],[0,"\\n\\t"],[10],[0,"\\n\\n\\t"],[7,"h3"],[9],[0,"§13 Der Beirat"],[10],[0,"\\n\\t"],[7,"ol"],[9],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Beim Vorstand des Fördervereins wird ein Beirat mit bis zu vier Mitgliedern gebildet. Ihm soll der Wehrleiter der Feuerwehr vorstehen. Der Vorstand des Fördervereins und der Vorsitzende des Beirates ernennen die weiteren Mitglieder und berufen diese ab.Der Vorstand fasst seine Beschlüsse mit der Mehrheit seiner gewählten Mitglieder. Beschlussfassung auf schriftlichen Weg ist zulässig.\\n    "],[10],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Der Beirat berät den Vorstand fachlich in allen organisatorischen und finanziellen Fragen. Zwei Mitgliedern des Fördervereins, die nicht im geschäftsführenden Vorstand tätig sind und von der Mitgliederversammlung zu benennen sind, obliegt die Kassenprüfung.\\n    "],[10],[0,"\\n\\t"],[10],[0,"\\n\\n\\t"],[7,"h3"],[9],[0,"§14 Auflösung des Fördervereins"],[10],[0,"\\n\\t"],[7,"ol"],[9],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Die Auflösung des Fördervereins kann nur durch eine Mitgliederversammlung beschlossen werden, in der mindestens zwei Drittel aller ordentlichen Mitglieder anwesend sind. Sie bedarf der Mehrheit von zwei Dritteln der abgegebenen Stimmen.\\n    "],[10],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Ist eine zu diesem Zwecke einberufene Mitgliederversammlung nicht beschlussfähig, so kann eine binnen 14 Tagen erneut einzuberufende Versammlung, auch bei Anwesenheit einer geringen Zahl von Mitgliedern, mit der Mehrheit von zwei Dritteln der abgegebenen Stimmen die Auflösung beschließen.\\n    "],[10],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Falls die Mitgliederversammlung nichts anderes beschließt, sind der Vorsitzende und sein Vertreter gemeinsam Liquidatoren.\\n    "],[10],[0,"\\n    "],[7,"li"],[9],[0,"\\n      Über die Verwendung des Vereinsvermögens entscheidet die Mitgliederversammlung, die den Auflösungsbeschluss fasst, mit einfacher Mehrheit. Das nach Abdeckung aller Verbindlichkeiten verbleibende Restvermögen darf nur zu den in §3 bestimmten Zielen des Fördervereins verwendet werden.\\n      "],[7,"br"],[9],[10],[0,"Bei Auflösung des Vereins oder durch Wegfall steuerbegünstigter Zwecke fällt das Vermögen des Vereins an den\\n      "],[7,"br"],[9],[10],[7,"strong"],[9],[0,"Förderverein zur Rettung der Schlosskirche Molsdorf e.V."],[10],[0,"\\n      "],[7,"br"],[9],[10],[7,"strong"],[9],[0,"Wiesengasse 2"],[10],[0,"\\n      "],[7,"br"],[9],[10],[7,"strong"],[9],[0,"99094 Erfut-Molsdorf"],[10],[0,"\\n      "],[7,"br"],[9],[10],[0,"der es ausschließlich und unmittelbar zur Unterhaltung / Sanierung der Schlosskirche St. Trinitatis zu Molsdorf zu verwenden hat.\\n    "],[10],[0,"\\n\\t"],[10],[0,"\\n\\n"],[10],[0,"\\n\\n"],[7,"section"],[9],[10],[0,"\\n"]],"hasEval":false}',meta:{moduleName:"feuerwehr-molsdorf/templates/statute.hbs"}})
